import React, { useEffect, useState } from "react";
import axios from "axios";
function PersonList() {
  const [persons, setpersons] = useState([]);
  useEffect(() => {
    axios.get("http://127.0.0.1:8000/api/person/").then((res) => {
      console.log(res);
      setpersons(res.data);
    });
  });
  return (
    <div>
      <form action="">
        <input type="text" />
        <button>add</button>
      </form>
      <hr />
      <ul>
        {persons.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default PersonList;
